INSERT INTO `g_aboutus` VALUES (1,'关于我',0,'0,1,','1982年10月出生，本科学历，中级工程师，PMP。2006年6月至今，在江苏省生产力促进中心▪理化测试服务中心担任技术经理职务。围绕科技系统信息服务，从事软件开发、研究等工作，先后参与省级科研项目6项，并作为主要开发人员，并作为主要开发人员，先后开发了金册网（江苏省一站式检测公共服务平台）、苏南国家自主创新示范区等网站，获取软件著作权10多项（主要开发）。','',1);
