  `addtime` datetime DEFAULT NULL,
  `onlinetime` datetime DEFAULT NULL,
  `logintimes` int(11) DEFAULT '0',
  `lastlogintime` datetime DEFAULT NULL,
  `lastloginip` varchar(50) DEFAULT NULL,
  `remark` text COMMENT '简介',
  `homepage` varchar(255) DEFAULT NULL,
  `typeid` int(11) DEFAULT '0' COMMENT '单位属性',
  `region` varchar(255) DEFAULT NULL COMMENT '地区代码',
  `zc` varchar(255) DEFAULT NULL COMMENT '职称',
  `tech_field` varchar(255) DEFAULT NULL COMMENT '技术领域',
  `nrii` varchar(255) DEFAULT NULL COMMENT '国家平台授权账号',
  `uptime` datetime DEFAULT NULL COMMENT '更新时间',
  `dsid` int(11) DEFAULT '0' COMMENT '导师',
  PRIMARY KEY (`userid`),
  UNIQUE KEY `单位` (`company`),
  UNIQUE KEY `国家平台` (`nrii`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

